import React, { Component } from 'react';
import styled from 'styled-components'

const titleStyle = {
  fontSize: '4rem',
  lineHeight: '1.6',
  color: '#222'
}

const NavMenu = () => {
    return (
        
        <div className="container-fulid shadow-sm rounded">
            <nav className="navbar-expand-lg bg-dark fixed-top">
                <div className="container text-center">
                    <div  className="d-flex justify-content-center">
                        <a className="nav-item nav-link" style={titleStyle} href="/">HOME</a>
                        <a className="nav-item nav-link" href="/about">ABOUT</a>
                        <a className="nav-item nav-link" href="/about">PATREON</a>
                    </div>
                </div>
            </nav>
      </div>
    );
  }


export default NavMenu;
